INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Chris Wedge', '1957-03-20', 'Binghamton, New York, USA', 'nm0917188', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ3OTE5MjcxNV5BMl5BanBnXkFtZTgwMTE0MTU0MjE@._V1_.jpg', 'John Christian Wedge was born on March 20, 1957 in Binghamton, New York. After graduating from Fayetteville-Manlius High School, Wedge went to study at the State University of New York at Purchase, where he received a BFA in film, and soon after that he went on to study at Ohio State University, earning him a MA in computer graphics and art education.');
