INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Lucas Till', '1990-08-10', 'Fort Hood, Texas, USA', 'nm1395771', 'https://images-na.ssl-images-amazon.com/images/M/MV5BODA5ODYwMDc4Nl5BMl5BanBnXkFtZTcwODM1MDA0NQ@@._V1_.jpg', 'Lucas Daniel Till was born in Fort Hood, Texas, to Dana Lyn (Brady) and John Mark Till, a lieutenant colonel in the army. He spent most of his childhood growing up in the suburbs of Atlanta, Georgia. At a very young age, Lucas\' family quickly noticed that he had an affinity for impersonating voices and characters.');
