INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Barry Pepper', '1970-04-04', 'Campbell River, British Columbia, Canada', 'nm0001608', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTc5NTg4NjkwNF5BMl5BanBnXkFtZTcwMjIxNjc2OQ@@._V1_.jpg', 'Barry Robert Pepper was born on April 4, 1970, in Campbell River, British Columbia, Canada, as the youngest of three sons. He has two older brothers named Alex and Doug Pepper. The Peppers didn\'t stick around Campbell River for too long. They had been building a ship in their backyard for years.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Rob Lowe', '1964-03-17', 'Charlottesville, Virginia, USA', 'nm0000507', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNDY2NjYxMDY0MF5BMl5BanBnXkFtZTcwMDc3MTMwNw@@._V1_.jpg', 'Rob Lowe was born in Charlottesville, Virginia, to Barbara Lynn (Hepler), a schoolteacher, and Charles Davis Lowe, a lawyer. His brother is actor Chad Lowe. He has German, as well as English, Irish, Scottish, and Welsh ancestry. Lowe\'s family moved to Dayton, Ohio, when he was a child.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Danny Glover', '1946-07-22', 'San Francisco, California, USA', 'nm0000418', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTI4ODM2MzQwN15BMl5BanBnXkFtZTcwMjY2OTI5MQ@@._V1_.jpg', 'Actor, producer and humanitarian Danny Glover has been a commanding presence on screen, stage and television for more than 25 years.Glover was born in San Francisco, California, to Carrie (Hunley) and James Glover, postal workers who were also active in civil rights.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Amy Ryan', '1968-05-03', 'Queens, New York City, New York, USA', 'nm0752407', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY0MTcwMzM0Nl5BMl5BanBnXkFtZTcwODIyMjM3NA@@._V1_.jpg', 'Amy Ryan was born on May 3, 1969 in Queens, New York City, New York, USA as Amy Beth Dziewiontkowski. She is an actress, known for "Birdman or (The Unexpected Virtue of Ignorance)", "Gone Baby Gone" and "Escape Plan". She has been married to Eric Slovin since August 23, 2011.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Holt McCallany', '1963-09-03', 'New York City, New York, USA', 'nm0564697', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTM0MzYzMjgyNV5BMl5BanBnXkFtZTcwMjk1MzMzMQ@@._V1_.jpg', 'Holt McCallany was born into a family of New York City actors; his mother was the renowned singer/actress Julie Wilson, and his father was a Tony Award winning actor and producer. He began school in Dublin, Ireland at the age of five before his parents moved back to NY.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Frank Whaley', '1963-07-20', 'Syracuse, New York, USA', 'nm0001844', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNzkyODAyMDA1N15BMl5BanBnXkFtZTcwOTEyNDk0OQ@@._V1_.jpg', 'Frank Whaley is a critically acclaimed actor/writer/director. He is best known for the films "Pulp Fiction" and "Swimming with Sharks", and has worked with Oliver Stone multiple times. His feature directorial debut, "Joe the King", earned him the Waldo Salt Screenwriting prize at the 1999 Sundance Film Festival.');
