INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Daniel Bacon', '1970-10-30', 'Southampton, Hampshire, England, UK', 'nm0004028', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOTgxOTY1NjE0OV5BMl5BanBnXkFtZTgwMTc5MTMzMTE@._V1_.jpg', 'Daniel Bacon is an actor Living in London, UK. He began his career at 17 appearing in several Local projects and internationally with Nickelodeon\'s Genie In The House.Daniel Graduated from Birmingham School Of Acting in 2011 with a BA Honors degree in Acting, and has since worked as an Actor In South America, Romania, and The United Kingdom.');
