INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Peter New', '1971-10-30', 'Vancouver, British Columbia, Canada', 'nm0627586', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOTE2NzMwOTY0MV5BMl5BanBnXkFtZTYwMDg5OTYy._V1_.jpg', 'Born and raised in Vancouver (but for a year in New Zealand), Peter began acting in grade nine. He joined the Vancouver Youth Theatre at 16, and began a comedy troupe called The Legend of Bonefish at nineteen. After toiling for a decade in clubs and cabarets, Peter finally made the move to film and television where he began to find roles immediately, and to voice acting where his breakout was longer in the making, but perhaps even more well-received when it came.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Simon Chin', '1975-02-26', 'Montreal, Quebec, Canada', 'nm1777809', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTgzNTU3NDI5N15BMl5BanBnXkFtZTgwMDQxMTQxMDI@._V1_.jpg', 'Simon was born in Montreal, Quebec, Canada but his family moved to Saskatoon, Saskatchewan when he was a year old. He received a Certificate in Business Administration at the University of Saskatchewan before entering the film industry.It was during a tour of Universal Studios when Simon was bitten by the acting bug.');
