INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Stacy Albrecht', 'Unknown', '', 'nm7704548', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjAwMDQyOTMzNl5BMl5BanBnXkFtZTgwNTQyNzc4NzE@._V1_.jpg', 'Stacy Albrecht is a Canadian actress born in Calgary, Alberta, and raised in Kelowna, British Columbia. After graduating from high school, Stacy moved to Vancouver and attended Vancouver Film School (VFS) to further pursue her acting career. Remaining on the West Coast, Stacy is now expanding her knowledge in film by working in visual effects.');
