INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Debbie Evans', 'Unknown', '', 'nm0262700', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTgxOTYxMTcyOF5BMl5BanBnXkFtZTYwODYxMzcy._V1_.jpg', 'Debbie Evans is considered one of Hollywood\'s top stunt women. She began riding motorcycles at the age of six and started competing in the sport of motorcycle trials at the age of nine. By 1976, she became the first woman to reach the rank of expert, successfully competing against the men.');
