INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Kory Grim', '1979-03-31', 'Kaien Island, Prince Rupert, British Columbia, Canada', 'nm0342138', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTYyNTk2NjIwN15BMl5BanBnXkFtZTgwOTUxMDMwMzE@._V1_.jpg', 'Actor and Stuntman Kory Grim was born March 31st,1979 on Kaien Island in Canada. He is of Icelandic and Native descent and began his career at the age of sixteen performing stunts. He is a competitive athlete who has played Football,Rugby and Boxing his whole life.');
