INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Tim Davies', 'Unknown', 'Brisbane, Queensland, Australia', 'nm1777607', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Tim Davies is an arranger, orchestrator, and conductor. As an arranger he has written for the likes of Amy Winehouse, Cee Lo Green, Miguel, Akon, Salaam Remi, Nas, and many ensembles including the Los Angeles Philharmonic and the Metropol Orkest. He is also one of the busiest conductors and orchestrators in Hollywood.');
