INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jeremy Levy', 'Unknown', '', 'nm3032822', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Composer/Arranger/Orchestrator, Jeremy Levy has worked in nearly every medium in Los Angeles. As an orchestrator, he is in high demand with recent projects including The Peanuts Movie, Minions, Ant-Man, The Book of Life, Empire, and Revenge. Also a busy arranger, Levy co-leads the Budman/Levy Orchestra featuring LA\'s top musicians.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Kurt Oldman', 'Unknown', 'Solothurn, Switzerland', 'nm1119211', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTYzNzgwMTQwOF5BMl5BanBnXkFtZTcwNzU5ODc1Nw@@._V1_.jpg', 'Kurt Oldman is a Swiss born composer known for his prolific hybrid orchestral, razor sharp electronic, heart pounding industrial, provocative dark distorted and epic emotional scores for film, television and video games.His bold innovative commercial voice can be heard on a variety of shows with universal appeal such as Marvel\'s Guardians of The Galaxy, Paramount\'s Monster Trucks, HBO\'s Game of Thrones and CBS\'s The Good Wife.');
